import React from "react";

const Projects = props => {
  return (
    <>
      <div className="col-xl-6">
        <h1 className={props.className}>
          <i className={props.iconDev}></i>
          {props.title}
        </h1>
        {props.languages.map(item => {
          let years = 2;
          let nbreExp = (item.xp / years) * 100 + "%";

          return <></>;
        })}
      </div>
    </>
  );
};

export default Projects;
